import '../styles/highlight.css'


export default function HighlightTest(probs) {
return (

    <div>
    <h3>Highlightbox</h3>
    <h4 className="端bersichtName">{probs.端berschrift}</h4>
    <p className="text">{probs.text}</p>
    </div>
    );

}
